      <h2>About Us</h2>
     <p>At DeviceDynasty, we're dedicated to bringing you the latest innovations in electronics right to your fingertips. Explore our curated selection of cutting-edge gadgets, from smartphones and wearables to smart home devices and more. Find the perfect tech companion to enhance your lifestyle and stay ahead of the curve.</p>
     </div>

     <div style={{ marginTop: '50px' }}>
      <h2>Contact Us At</h2>
      <p>xxxxxxxxxxx</p> 
      <p style={{ marginTop: '0px' }}>devicedynasty@gmail.com</p> 
     </div>
    </>
  );
};

export default About;
